// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import UserList from './UserList';
import UserForm from './UserForm';
import './App.css';

function App() {
    return (
        <Router>
            <div className="App">
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Lista de Usuarios</Link>
                        </li>
                        <li>
                            <Link to="/kallpa">Registrar en Kallpa</Link>
                        </li>
                        <li>
                            <Link to="/energy">Registrar en Energy</Link>
                        </li>
                    </ul>
                </nav>

                <Routes>
                    <Route path="/" element={<UserList />} />
                    <Route path="/kallpa" element={<UserForm company="Kallpa" />} />
                    <Route path="/energy" element={<UserForm company="Energy" />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
